Всем привет!

Компания *Северсталь* продолжает поиск молодых и увлеченных машинным обучением *Аналитиков Данных* с базированием в Москве. 

Обязанности:
•	Сбор данных из внутренних баз данных и работа с внешними источниками информации;
•	Взаимодействие с заказчиком в процессе реализации задачи;
•	Проведение Exploratory Data Analysis.

Требования:
•	Высшее техническое/математическое/экономическое;
•	Умение писать SQL-запросы;
•	Программирование на языке R или Python;
•	Готовность изучать новые языки программирования;
•	Понимание принципов работы машинного обучения.

По компенсации готовы обсуждать от 120 000 -150 000 гросс руб в мес. 
Большое количество данных гарантируем.
